import "./index.css"

function App(props) {
  console.log(props)
  return (
    <BrowserRouter>
    <React.Fragment>
      <Header />
      <Content />
    </React.Fragment>
      <Switch>
        <Router props path='/'></Router>
      </Switch>
    </BrowserRouter>

  );
}

export default App;
